import "./App.css";
import Header from "./components/Header";
import Body from "./components/Body";
import Footer from "./components/Footer";

function App() {
  const name = "ddd";
  return (
    <div className="App">
      <Header />
      <Body name={name} location={"서울시"} />
      <Footer />
    </div>
  );
}

export default App;
